package crypto.digest;import crypto.Digest;import crypto.constant.AlgorithmConstant;import crypto.model.Algorithm;/** * @author loquy * @date 2023/02/09 9:12 */public class SM3 implements Digest {    private final Algorithm algorithm;    public SM3(Algorithm algorithm) {        this.algorithm = algorithm;    }    @Override    public String digestHex() throws Exception {        return digestHex(algorithm.getRawData(), AlgorithmConstant.SM3);    }}